import { createContext } from "react"
import CompB from "./CompB"

const arr =[
    {name:'Junaid',age:'20'},
    {name:'Sanaya',age:'9'},
    {name:'Anaya',age:4}
]

const firstName = createContext()
// console.log(firstName);
function CompA() {
    return (
        <>
            <firstName.Provider value={arr} >
                <CompB />
            </firstName.Provider>

        </>
    )
}
export default CompA
export { firstName }
